import React from 'react';
import '../App.css';

const AboutUs = () => {
    return (
        <div className="about-us-container">
            <h1 className="about-us-title">Our Vision</h1>
            <div className="about-us-content">
                <p className="about-us-paragraph">
                    We aim at depicting <strong>cultural diversity</strong> in a fashionable way through love with style, art, storytelling, and unique pieces for you. Emphasis on making every woman feel classy, confident, and fashionable in a deliberate way. Luxury must be comfortable otherwise it is not Luxury. The beauty of the clothing you wear should illustrate the happiness you feel.
                </p>
                <img src='./images/logo.png' />
            </div>
        </div>
    );
};

export default AboutUs;
